import { createUseStyles } from "react-jss";

const useStyles = createUseStyles({
    main: {
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        width: "100%",
        height: "100%",
        backgroundColor: "#f5f5f5",
    },
    contact: {
        display: "flex",

    }
});

export default useStyles;
